      return div;

    function parseCSV(text){
      const lines = text.trim().split(/\r?\n/);
      if(!lines.length) return [];
      const headers = lines.shift().split(',').map(h=>h.trim());
      function unq(s){ return s.replace(/^"(.*)"$/,'$1').replace(/""/g,'"'); }
      return lines.map(line=>{
        let arr=[], cur='', q=false;
        for(let i=0;i<line.length;i++){
          const c=line[i];
          if(c=='"'){ q=!q; cur+=c; }
          else if(c==',' && !q){ arr.push(cur); cur=''; }
          else { cur+=c; }
        }
        arr.push(cur);
        const obj={};
        headers.forEach((h,i)=> obj[h]=unq(arr[i]||''));
        return obj;
      });
    }

    function buildSheetLayer(rows, baseData){

        const pw = parseInt(r['PW #'] || r['PW']); const dmg = parseInt(r['Damage #'] || r['Damage']);

          "<b>Proyecto #:</b> " + proj + "<br>" +
          "<b>PW:</b> " + (b.pw!=null?b.pw:'N/D') + "<br>" +
          "<b>Daño #:</b> " + (b.damage!=null?b.damage:'N/D') + "<br>" +
          "<b>Estatus:</b> " + status + "</div>";

      });
